      <h1> digiXnode </h1>
      <div className="links">
        <a href="/"> Home </a>
        <a href="/certify"> Notarize </a>
        <a href="/vertify"> Verify </a>
        <a href="/fetch"> Get your doc </a>
        {/* <a href="/fetch" style={{
